import React from "react";

function Note(props) {

  function handleClick() {
    props.onDeletesetItems((preItems)=> {
      return preItems.filter(
        (item, index) => {
          return index !== id;
        }
      )
    })
  }

  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick={handleClick} >DELETE</button>
    </div>
  );
}

export default Note;
